import React from 'react'
import { useNavigate } from 'react-router-dom'
import styles from './MainPage.module.css'
import logo from '../../assets/images/logo.jpg' 

const MainPage = () => {
    const navigate = useNavigate()

    const handleNavClick = (page) => {
        navigate(`/${page.toLowerCase()}`)
    }

    return (
        <div className={styles.logoContainer}>
            <img src={logo} alt="DTU Logo" className={styles.logo} />
            <div className={styles.navLines}>
                <div className={styles.navLine} onClick={() => handleNavClick('Home')} data-page="Home">Home</div>
                <div className={styles.navLine} onClick={() => handleNavClick('About')} data-page="About">About</div>
                <div className={styles.navLine} onClick={() => handleNavClick('Services')} data-page="Services">Services</div>
                <div className={styles.navLine} onClick={() => handleNavClick('Contact')} data-page="Contact">Contact</div>
            </div>
        </div>
    )
}

export default MainPage
